import React from 'react';
import ModalImage from "react-modal-image";

const ProductCardInCheckout = ({ p }) => {
    return (
        <tbody>
            <tr>
                <td>
                    <div>
                        {}
                    </div>
                </td>
                <td>{p.title}</td>
                <td>${p.price}</td>
                <td>{p.brand}</td>
                <td>{p.color}</td>
                <td>{p.count}</td>
                <td>Shipping Icon</td>
                <td>Delete Icon</td>
            </tr>
        </tbody>
    );
}

export default ProductCardInCheckout;
